import React, { Component } from "react";
import {
  getEvents,
  fetchEventsbyDate,
  fetchEventsbyNames
} from "../services/eventService";

class Home extends Component {
  state = {
    publicEvents
  };

  async componentDidMount() {
    const { data } = await getEvents();
    const publicEvents = [...data];

    this.setState({ publicEvents });
  }

  render() {
    return (
      <div>
        <div className="row">
          <div className="col-md-4">
            <button
              className="btn btn-primary"
              style={{ marginTop: 10, width: "100%" }}
              onClick={() => {
                "asd";
              }}
            >
              <h4>Download New Public Events</h4>
            </button>
          </div>
          <div className="col-md-4">
            <button
              className="btn btn-primary"
              style={{ marginTop: 10, width: "100%" }}
              onClick={() => {
                "asd";
              }}
            >
              <h4>Fetch Events by Repo Names</h4>
            </button>
          </div>
          <div className="col-md-4">
            <button
              className="btn btn-primary"
              style={{ marginTop: 10, width: "100%" }}
              onClick={() => {
                "asd";
              }}
            >
              <h4>Fetch Events by Date</h4>
            </button>
          </div>
        </div>
        <div className="row">List</div>
      </div>
    );
  }
}
export default Home;
